  false,\n\t\"url\": null,\n\t\"notes\": \"Benthic habitat classes were derived for
  nearshore waters around Timor-Leste from WorldView-2 satellite imagery. Habitat
  classes include different combinations of shallow, mid and deep depths, soft (sand
  or mud) or hard (rubble, boulders, etc.) substrates, algae or seagrass dominated
  areas, intertidal areas and rocks. Supervised classifications were performed using
  several different methods and with imagery at several different stages of processing,
  with final classification based on the classification method and imagery variant
  that provided the  best overall results for each WorldView-2 image. \",\n\t\"license_title\":
